    public class CreateDetailMenu : MonoBehaviour, IInputClickHandler
    {
        public DetailMenu DetailMenuPrefab;
        public int NumberOfButtons = 1;
        public GameObject buttonPrefab;
        private DetailMenu menu;
        private DetailMenuResult _result;

        protected bool launchedMenu = false;


        #region IInputClickHandler

        public void OnInputClicked(InputClickedEventData eventData)
        {
            CreateDetailElement();
        }

        #endregion IInputClickHandler

        public void CreateDetailElement(DetailMenuResult result)
        {
            // TEST create_dialog:
            if (launchedMenu)
                return;
            launchedMenu = true;

            StartCoroutine(LaunchListingMenuOverTime(result));
        }

        public void CreateDetailElement()
        {
            if (launchedMenu)
                return;
            launchedMenu = true;
            var result = new DetailMenuResult();
            List<GameObject> buttons = new List<GameObject>();
            // MOG TIME, this should be given from homepage.

            List<string> names = new List<string>();
            List<MessageBoardContent> MBContent = new List<MessageBoardContent>();
            for (int i = 0; i < NumberOfButtons; i++)
            {
                names.Add(i+"");
            }

            // end of mog code::

            for (int i = 0; i < NumberOfButtons; i++)
            {
                // Create object
                var buttonGO = GameObject.Instantiate(buttonPrefab) as GameObject;
                // set click method
                var button = buttonGO.GetComponent<Button>();
                

                // set text:
                CompoundButtonText compoundButtonText = buttonGO.GetComponent<CompoundButtonText>();
                if (compoundButtonText)
                {
                    compoundButtonText.DisableText = true;
//                    // position of text:
//                    compoundButtonText.OverrideAnchor = true;
//                    compoundButtonText.OverrideOffset = false;
//                    compoundButtonText.Anchor = TextAnchor.MiddleCenter; 
//
//                    // text
//                    compoundButtonText.Text = names[i];
//                    // compoundButtonText.OverrideSize = true;
//                    // compoundButtonText.Size = 10;
                }

                var TextElement = buttonGO.transform.GetChild(2);
                TextElement.localScale = new Vector3(0.002180442f, 0.01f,0.002180442f);

                // set icon:
                CompoundButtonIcon compoundButtonIcon = buttonGO.GetComponent<CompoundButtonIcon>();
                if (compoundButtonIcon)
                {
//                    compoundButtonIcon.DisableIcon = true;
                    var transform = compoundButtonIcon.GetComponent<Transform>();
                   
                }

                // add to list:
                buttons.Add(buttonGO);
            }
            String Big =
                    "";
            String Wide = "";
            String leftSmall = "";
            String rightSmall = "";


            for (int i = 0; i < NumberOfButtons; i++)
            {
                var content = new MessageBoardContent();
                if (i == 0)
                {
                    content.workAreaContent = MessageBoardContent.Content.IMG;
                    content.workAreaImageString = Big;
                } else if (i == 1)
                {
                    content.topAreaContent = MessageBoardContent.Content.IMG;
                    content.topAreaImageString = Wide;

                    content.lowerLeftAreaContent = MessageBoardContent.Content.TEXT;
                    content.lowerLeftAreaText =
                        "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed commodo mattis accumsan. Aliquam interdum tincidunt erat, bibendum vehicula sem viverra ut. Pellentesque varius faucibus placerat. Sed odio libero, suscipit et felis et, rutrum ullamcorper odio.";
                    content.lowerRightAreaContent = MessageBoardContent.Content.TEXT;
                    content.lowerRightAreaText =
                        "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed commodo mattis accumsan. Aliquam interdum tincidunt erat, bibendum vehicula sem viverra ut. Pellentesque varius faucibus placerat. Sed odio libero, suscipit et felis et, rutrum ullamcorper odio.";
                }
                else
                {
                    content.topLeftAreaContent = MessageBoardContent.Content.IMG;
                    content.topLeftAreaImageString = leftSmall;

                    content.topRightAreaContent = MessageBoardContent.Content.IMG;
                    content.topRightAreaImageString = rightSmall;

                    content.lowerAreaContent = MessageBoardContent.Content.TEXT;
                    content.lowerAreaText =
                        "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis sit amet neque ac nibh hendrerit commodo a mattis eros. Suspendisse potenti. Vestibulum vel nunc pharetra, fermentum elit vel, dignissim urna. Duis auctor non felis in consectetur. Pellentesque quis mauris dignissim, eleifend nibh eu, malesuada nulla. Nunc pellentesque at ipsum non convallis. Suspendisse potenti. Pellentesque ultricies justo a lacinia hendrerit. Morbi sed elementum magna, nec lacinia neque. Praesent id molestie leo, eu hendrerit lacus. Duis eu tempus tellus. Mauris non lectus interdum, pellentesque quam sit amet, semper sem. Etiam euismod lacus ac urna mattis, at volutpat lorem porttitor.Cras finibus ligula.";
                }
                MBContent.Add(content);
            }

            result.createDetailMenuResult(buttons, names, MBContent);
            // made it local to use it on OnClick method.
            _result = result;
            StartCoroutine(LaunchListingMenuOverTime(_result));
        }

        /// <summary>
        /// Setter Method to set the Text at the top of the Dialog.
        /// </summary>
        /// <param name="title"></param>
        public void SetTitle(string title)
        {
            CompoundButtonText compoundButtonText = GetComponent<CompoundButtonText>();
            if (compoundButtonText)
            {
                compoundButtonText.Text = title;
            }
        }

        protected IEnumerator LaunchListingMenuOverTime(DetailMenuResult result)
        {
            menu = DetailMenu.Open(DetailMenuPrefab.gameObject, result);
            menu.OnClosed += OnClosed;

            // Wait for dialog to close

            while (menu.State != MenuState.Closed)
            {
                yield return null;
            }

            launchedMenu = false;
            yield break;
        }

        protected void OnClosed(DetailMenuResult result)
        {
        }
    }
}